body.value:
calc(
      var(--size-4-2) + var(--button-inset-shadow-size)
    )
    var(--size-4-3) var(--size-4-2) var(--size-4-3)

calc(
      var(--size-2-2) + var(--button-inset-shadow-size)
    )
    var(--size-4-2) var(--size-2-3) var(--size-2-3)

.theme-light.value:
color-mix(
    in srgb,
    var(--link-ahref-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-unresolved-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-unresolved-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-external-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-external-color-hover) var(--link-decoration-opacity),
    transparent
  )

.theme-dark.value:
color-mix(
    in srgb,
    var(--link-ahref-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-unresolved-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-unresolved-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-color-hover) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-external-color) var(--link-decoration-opacity),
    transparent
  )

color-mix(
    in srgb,
    var(--link-external-color-hover) var(--link-decoration-opacity),
    transparent
  )

.callout.value:
color-mix(
    in srgb,
    rgba(var(--callout-color)) var(--callout-color-opacity),
    var(--editor-bg-color)
  )

.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )
